import React, { Component } from 'react';


class FireTypeList extends Component {
	render() {
		return (
			<div>
				<h3>Fire Type</h3>
	      <ul>
	        <li>{ this.props.fire[0].name }</li>
	        <li>{ this.props.fire[1].name }</li>
	        <li>{ this.props.fire[2].name }</li>
	      </ul>
      </div>
		)
	}
}




export default FireTypeList;
